import React, { useState } from 'react';
import './PropertyForm.css'; // Your custom CSS file
import 'bootstrap/dist/css/bootstrap.min.css'; // Bootstrap CSS
import { Link } from 'react-router-dom';

function PropertyForm() {
  // State variables for structure details
  const [currentMarketValue, setCurrentMarketValue] = useState('');
  const [carpetArea, setCarpetArea] = useState('');
  const [pincode, setPincode] = useState('');
  const [buildingAge, setBuildingAge] = useState('');
  const [propertyEffect, setPropertyEffect] = useState('No');

  // State variables for security measures
  const [security24x7, setSecurity24x7] = useState('No');
  const [isSalaried, setIsSalaried] = useState('No');

  // State variable for tracking validation errors
  const [validationErrors, setValidationErrors] = useState({});

  // Proceed button click handler
  const handleProceed = () => {
    // Validation check for empty input values
    const errors = {};
    if (!currentMarketValue) errors.currentMarketValue = 'Enter the number';
    if (!carpetArea) errors.carpetArea = 'Enter the number';
    if (!pincode) errors.pincode = 'Enter the number';

    if (Object.keys(errors).length > 0) {
      // Set validation errors and prevent further action
      setValidationErrors(errors);
      return;
    }

    // Continue with further actions or submit the form
    console.log('Form submitted:', {
      currentMarketValue,
      carpetArea,
      pincode,
      buildingAge,
      propertyEffect,
      security24x7,
      isSalaried,
    });
  };

  return (
    <div className="form-container ">
      <h2>Structure Details</h2>

      <form className="form-container container">
        <div className={`form-group ${validationErrors.currentMarketValue ? 'has-error' : ''}`}>
          <label>Current Market Value of Property:</label>
          <input
            type="text"
            className="form-control"
            value={currentMarketValue}
            onChange={(e) => {
              setCurrentMarketValue(e.target.value);
              setValidationErrors({ ...validationErrors, currentMarketValue: '' });
            }}
          />
          {validationErrors.currentMarketValue && (
            <small className="error-text">{validationErrors.currentMarketValue}</small>
          )}
        </div>

        <div className={`form-group ${validationErrors.carpetArea ? 'has-error' : ''}`}>
          <label>Carpet Area/sq.ft:</label>
          <input
            type="text"
            className="form-control"
            value={carpetArea}
            onChange={(e) => {
              setCarpetArea(e.target.value);
              setValidationErrors({ ...validationErrors, carpetArea: '' });
            }}
          />
          {validationErrors.carpetArea && (
            <small className="error-text">{validationErrors.carpetArea}</small>
          )}
        </div>

        <div className={`form-group ${validationErrors.pincode ? 'has-error' : ''}`}>
          <label>Enter Pincode:</label>
          <input
            type="text"
            className="form-control"
            value={pincode}
            onChange={(e) => {
              setPincode(e.target.value);
              setValidationErrors({ ...validationErrors, pincode: '' });
            }}
          />
          {validationErrors.pincode && (
            <small className="error-text">{validationErrors.pincode}</small>
          )}
        </div>

        {/* Rest of your form inputs ... */}

      </form>

      <h2>Security Measures</h2>

      <form className="form-container container">
        <div className="form-group ">
          {/* ... */}
        </div>

        <div className="form-group ">
          {/* ... */}
        </div>
      </form>

      <div className="form-control container">
        <button className="btn btn-primary" onClick={handleProceed}>
          Calculate
        </button>
        <Link to="/formPage" className="btn btn-primary proceed-link ml-4">
          Proceed to Payment
        </Link>
      </div>
    </div>
  );
}

export default PropertyForm;
